    'interpolateCategorical': function (domain, range) {
      var color = d3.scale.ordinal()
        .domain(domain)
        .range(d3.range(domain.length).map(d3.scale.linear()
          .domain([0, domain.length - 1])
          .range(range)
          .interpolate(d3.interpolateLab)));

      return function (d) {
        return color(d);
      };
    },
